};

return(
  <div className='masla'>
  <div className='dabba'>
    <h2>
      Behal's ToDo List inputList}
    </h2>
    <input type='text' placeholder='Mention Task' onChange={itemEvent}/>
    <button> + </button>
  </div>
  <Tasks/>
  </div>
)
};

export default App;
